import profilePic from '../images/profile-pic.PNG';

function Home(props) {
    const styles = {
        hero: {
            padding: '50px',
            backgroundColor: '#EBD7C1'
        },
        img: {
            display: 'block',
            marginLeft: 'auto',
            marginRight: 'auto',
            borderRadius: '50%',
            height: '300px',
            width: '320px'
        },
        intro: {
            marginTop: '30px',
            textAlign: 'center',
            lineHeight: '40px',
            color: '#462920'
        },
        button: {
            backgroundColor: 'rgb(128, 108, 84)',
            color: '#fff',
            height: '40px',
            border: 'none',
            borderRadius: '5px',
            width: '100px'
        }
      }

    return (
        <div className='hero' style={styles.hero}>
            <div>
                <img src={profilePic} alt="profile" style={styles.img} />
            </div>
            <div className='intro' style={styles.intro}>
                <h1>Hey, I'm Tamzin!</h1>
                <p>Front-End Web Developer</p>
                <p>Creating impactfulI'm confident in my ability to create beautiful and functional websites, using my attention to detail and passion for user experiences to create impactful and memorable online presences.</p>

                <button style={styles.button} href="mailto:tamzin.chikhalia@gmail.com" role="button">Contact Me</button>
            </div>
        </div>
    );
  }

  export default Home;
